import React from 'react'
import { Container } from 'react-bootstrap'

const About = () => (
    <Container fluid style={{backgroundColor: '#212529', color: '#fff'}}>
        <Container style={{display: 'flex', justifyContent: 'center', padding: '10px'}}>
            <p>Кофе мечты</p>
        </Container>
    </Container>
)

export default About;
